void draw_BSOD(ILI9341_t3& display)
{
    // Set colors
    display.fillScreen(bsod_bg_windows_10);
    display.setTextColor(bsod_fg_windows_10);

    // Draw :( emoticon
    // Top dot
    int height = sizeof(win10_bsod_frown_dot) / sizeof(win10_bsod_frown_dot[0]);
    int width = sizeof(win10_bsod_frown_dot[0]) / sizeof(win10_bsod_frown_dot[0][0]);
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(20 + x, 39 + y, win10_bsod_frown_dot[y][x]);
        }
    }
    // Bottom dot (flipped vertically)
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(20 + x, 77 + (height - y), win10_bsod_frown_dot[y][x]);
        }
    }
    // Top of paren
    height = sizeof(win10_bsod_frown_paren_half) / sizeof(win10_bsod_frown_paren_half[0]);
    width = sizeof(win10_bsod_frown_paren_half[0]) / sizeof(win10_bsod_frown_paren_half[0][0]);
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(42 + x, 20 + y, win10_bsod_frown_paren_half[y][x]);
        }
    }
    // Bottom of paren (flipped vertically)
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(42 + x, 19 + (2 * height) - y, win10_bsod_frown_paren_half[y][x]);
        }
    }

    // Draw useless generic Windows 10 error text
    // Line 1
    height = sizeof(win10_bsod_text1) / sizeof(win10_bsod_text1[0]);
    width = sizeof(win10_bsod_text1[0]) / sizeof(win10_bsod_text1[0][0]);
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(x + 78, y + 30, win10_bsod_text1[y][x]);
        }
    }
    // Line 2
    height = sizeof(win10_bsod_text2) / sizeof(win10_bsod_text2[0]);
    width = sizeof(win10_bsod_text2[0]) / sizeof(win10_bsod_text2[0][0]);
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(x + 78, y + 55, win10_bsod_text2[y][x]);
        }
    }
    // Line 3
    height = sizeof(win10_bsod_text3) / sizeof(win10_bsod_text3[0]);
    width = sizeof(win10_bsod_text3[0]) / sizeof(win10_bsod_text3[0][0]);
    for (int y(0); y < height; ++y)
    {
        for (int x(0); x < width; ++x)
        {
            display.drawPixel(x + 78, y + 80, win10_bsod_text3[y][x]);
        }
    }

    // Prepare to print error text
    display.setCursor(0, 124);
    display.setFontAdafruit();
}
